import React, { useEffect, useState } from 'react';
import axios from 'axios';
import './DoctorList.css';

const DoctorList = () => {
  const [doctors, setDoctors] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:8000/api/doctors/')
      .then(res => setDoctors(res.data))
      .catch(err => console.log(err));
  }, []);

  return (
    <div className="container doctor-list">
      <h2 className="text-center mb-4">üë®‚Äç‚öïÔ∏è Available Doctors</h2>
      <div className="row">
        {doctors.map((doc, index) => (
          <div className="col-md-4 mb-4" key={index}>
            <div className="card shadow-sm border-0">
              <div className="card-body">
                <h5 className="card-title">{doc.name}</h5>
                <p className="card-text">Speciality: {doc.speciality}</p>
                <p className="card-text">Department: {doc.department}</p>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
};

export default DoctorList;
